import React from 'react';
import { 
  styled, 
  AppBar, 
  Box, 
  Toolbar, 
  IconButton, 
  InputBase
} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';

const HeadNav = styled(Box)(() => ({
  position: 'fixed',
  width: '100%',
  backgroundColor: 'transparent',
}));

const Search = styled('div')(() => ({
  position: 'relative',
  backgroundColor: '#008BF0',
  borderRadius: '15px',
}));

const SearchIconWrapper = styled('div')(() => ({
  padding: '0px 5px 0px 5px',
  height: '100%',
  position: 'absolute',
  pointerEvents: 'none',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  color: '#ffffff',
}));

const StyledInputBase = styled('InputBase')(() => ({
  color: '#ffffff',
  paddingLeft: '30px',
}));

export default function PrimarySearchAppBar() {

  return (
    <Box sx={{ flexGrow: 1 }}>
      <HeadNav>
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="open drawer"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Search>
            <SearchIconWrapper>
              <SearchIcon />
            </SearchIconWrapper>
            <StyledInputBase
              placeholder="Searchâ€¦"
              inputProps={{ 'aria-label': 'search' }}
            />
          </Search>
          <Box sx={{ flexGrow: 1 }} />
        </Toolbar>
      </HeadNav>
    </Box>
  );
}
